-- Function structure for mock_data
-- ----------------------------
DROP FUNCTION IF EXISTS `mock_data`;
delimiter ;;
CREATE FUNCTION `mock_data`()
 RETURNS int
BEGIN        -- 函数方法体开始
 DECLARE num INT DEFAULT 370;   -- 定义一个变量num为int类型。默认值为100 0000
 DECLARE i INT DEFAULT 0; 
 
 WHILE i < num DO     -- 循环条件
   VALUES(NULL, '20502010003',DATE_ADD('2021-12-18',interval i day),FLOOR( 0 + RAND() * (86400000)));
  SET i =  i + 1; -- i自增 
 END WHILE;  -- 循环结束
 RETURN i;
END
;;
delimiter ;

